import React from "react";
import rawData from "../postData.json";
import PostThumb from "../components/PostThumb.js"
  
const Root = () => {

  const [postData, setPostData] = React.useState(rawData);

  React.useEffect(()=>{
    setPostData(rawData.results)
  }, []);

  let listPosts = postData.map(post =>
    <PostThumb
    title = {post.title}
    key = {post.id}
    />
    );

  return (
    <div>
        <section className="title">
          <h1>Tiago Almeida</h1>
          <h2>Copywriter</h2>
        </section>

        <section className="articles">
          <a href="/Post" className="article"><h3>Teste</h3></a>
